import React, { useState, useEffect } from 'react';
import { Link, useLocation } from 'react-router-dom';
import { Navbar, Nav, Container, Button, Dropdown } from 'react-bootstrap';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';

const Header = () => {
  const [scrolled, setScrolled] = useState(false);
  const location = useLocation();

  // Handle navbar background change on scroll
  useEffect(() => {
    const handleScroll = () => {
      if (window.scrollY > 50) {
        setScrolled(true);
      } else {
        setScrolled(false);
      }
    };

    window.addEventListener('scroll', handleScroll);
    return () => {
      window.removeEventListener('scroll', handleScroll);
    };
  }, []);

  // Determine if the link is active
  const isActive = (path) => {
    return location.pathname === path;
  };

  return (
    <Navbar 
      expand="lg" 
      variant="dark"
      fixed="top"
      className={`custom-navbar ${scrolled ? 'bg-dark' : 'bg-transparent'} transition-all`}
    >
      <Container>
        <Navbar.Brand as={Link} to="/" className="d-flex align-items-center">
          <FontAwesomeIcon 
            icon="calendar-alt" 
            size="lg" 
            className="me-2 text-info" 
            beat={scrolled}
          />
          <span data-aos="fade-right" data-aos-delay="200">College Events</span>
        </Navbar.Brand>

        <Navbar.Toggle aria-controls="navbar-nav">
          <span className="navbar-toggler-icon"></span>
        </Navbar.Toggle>

        <Navbar.Collapse id="navbar-nav">
          <Nav className="mx-auto">
            <Nav.Link 
              as={Link} 
              to="/" 
              className={`px-3 ${isActive('/') ? 'active' : ''}`}
              data-aos="fade-down"
              data-aos-delay="300"
            >
              <FontAwesomeIcon icon="home" className="me-2" />
              Home
            </Nav.Link>

            <Nav.Link 
              as={Link} 
              to="/about" 
              className={`px-3 ${isActive('/about') ? 'active' : ''}`}
              data-aos="fade-down"
              data-aos-delay="400"
            >
              <FontAwesomeIcon icon="info-circle" className="me-2" />
              About
            </Nav.Link>

            <Dropdown
              as={Nav.Item}
              data-aos="fade-down"
              data-aos-delay="500"
            >
              <Dropdown.Toggle 
                as={Nav.Link} 
                className="px-3 d-flex align-items-center"
              >
                <FontAwesomeIcon icon="calendar-alt" className="me-2" />
                Events
                <FontAwesomeIcon icon="chevron-down" className="ms-2 small" />
              </Dropdown.Toggle>
              <Dropdown.Menu className="border-0 shadow">
                <Dropdown.Item as={Link} to="/events/academic">
                  <FontAwesomeIcon icon="graduation-cap" className="me-2 text-primary" />
                  Academic Events
                </Dropdown.Item>
                <Dropdown.Item as={Link} to="/events/cultural">
                  <FontAwesomeIcon icon="music" className="me-2 text-success" />
                  Cultural Events
                </Dropdown.Item>
                <Dropdown.Item as={Link} to="/events/sports">
                  <FontAwesomeIcon icon="trophy" className="me-2 text-danger" />
                  Sports Events
                </Dropdown.Item>
                <Dropdown.Item as={Link} to="/events/workshops">
                  <FontAwesomeIcon icon="chalkboard-teacher" className="me-2 text-info" />
                  Workshops
                </Dropdown.Item>
                <Dropdown.Divider />
                <Dropdown.Item as={Link} to="/events/all">
                  <FontAwesomeIcon icon="list" className="me-2" />
                  All Events
                </Dropdown.Item>
              </Dropdown.Menu>
            </Dropdown>

            <Nav.Link 
              as={Link} 
              to="/contact" 
              className={`px-3 ${isActive('/contact') ? 'active' : ''}`}
              data-aos="fade-down"
              data-aos-delay="600"
            >
              <FontAwesomeIcon icon="envelope" className="me-2" />
              Contact
            </Nav.Link>
          </Nav>

          <Nav className="auth-buttons">
            <Button 
              as={Link} 
              to="/login" 
              variant="outline-light" 
              className="me-2"
              data-aos="fade-left"
              data-aos-delay="700"
            >
              <FontAwesomeIcon icon="sign-in-alt" className="me-2" />
              Login
            </Button>
            <Button 
              as={Link} 
              to="/register" 
              variant="info"
              data-aos="fade-left"
              data-aos-delay="800"
            >
              <FontAwesomeIcon icon="user-plus" className="me-2" />
              Register
            </Button>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
};

export default Header;
